export const DonationAmount = () => {
    return ( 
        <div>
        <label for="exampleFormControlInput1">Amount</label> 
        <input 
        type="email" 
        class="form-control" 
        id="exampleFormControlInput1" 
        placeholder="$ :)"
        onChange={(email) => this.setState({email:email.target.value})} 
        />
        </div>
     );
}
